import React, {Component} from 'react';

class Name extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <div className='nameDiv'>{this.props.name}</div>
                <button>Edit</button>

            </div>
        )
    }
}

export default Name;
